const Header = () => {
    return(
        <div>
            <div className= "nav-box">
                <div className= "about">
                    About
                </div>
            </div>
    <style jsx>{`
    
    .nav-box {
        position: absolute;
        width: 1344px;
        height: 74px;
        left: 0px;
        top: 0px;
        background: blue;
    }

    .about {
        position: absolute;
        width: 45px;
        height: 16px;
        left: 480px;
        top: 30px;
        font-family: Roboto;
        font-style: normal;
        font-weight: normal;
        font-size: 14px;
        line-height: 16px;
        color: #000000;
    }
    `}</style>
        </div>
    )
}

export default Header
